import React,{useState} from 'react'
import './todo.css'

const TodoApp = () => {
    const [Todo, setTodo] = useState(['Study','Excercise','Sleeping'])
    return (
        <div className="todo">
            <h2>To-Do-App</h2>
            <div>
                {Todo.map((todo)=>{
                    return(
                    <h3 key={todo}>
                        {todo}
                    </h3>
                    )
                })}
            </div>
        </div>
    )
}

export default TodoApp
